        <div>
            <h3>Title:</h3>
            <h3>Description:</h3>
            <h3>Category:</h3>
            <h3>Price:</h3>
            <h4>Created:</h4>
            <h4>User:</h4>
            <button onClick={test}>TEST</button>
        </div>
    )
}

export default ItemParts;
